<!DOCTYPE html>
<html lang="en" dir="ltr">

<head>
    <meta charset="utf-8">
    <title></title>
    <link rel="stylesheet" type="text/css" href="https://unpkg.com/jasmine-core@4.1.0/lib/jasmine-core/jasmine.css">
    <script type="text/javascript" src="https://unpkg.com/jasmine-core@4.1.0/lib/jasmine-core/jasmine.js"></script>
    <script type="text/javascript" src="https://unpkg.com/jasmine-core@4.1.0/lib/jasmine-core/jasmine-html.js"></script>
    <script type="text/javascript" src="https://unpkg.com/jasmine-core@4.1.0/lib/jasmine-core/boot0.js"></script>
    <script type="text/javascript" src="https://unpkg.com/jasmine-core@4.1.0/lib/jasmine-core/boot1.js"></script>
    <script type="text/javascript" src="app.js"></script>
    <script type="text/javascript" src="app.test.js"></script>
</head>

<body>



    <div class="jasmine_html-reporter">
        <div class="jasmine-banner"><a class="jasmine-title" href="http://jasmine.github.io/" target="_blank"></a><span
                class="jasmine-version">4.1.0</span>
            <div class="jasmine-run-options"><span class="jasmine-trigger">Options</span>
                <div class="jasmine-payload">
                    <div class="jasmine-stop-on-failure"><input class="jasmine-fail-fast" id="jasmine-fail-fast"
                            type="checkbox"><label class="jasmine-label" for="jasmine-fail-fast">stop execution on spec
                            failure</label></div>
                    <div class="jasmine-throw-failures"><input class="jasmine-throw" id="jasmine-throw-failures"
                            type="checkbox"><label class="jasmine-label" for="jasmine-throw-failures">stop spec on
                            expectation failure</label></div>
                    <div class="jasmine-random-order"><input class="jasmine-random" id="jasmine-random-order"
                            type="checkbox"><label class="jasmine-label" for="jasmine-random-order">run tests in random
                            order</label></div>
                    <div class="jasmine-hide-disabled"><input class="jasmine-disabled" id="jasmine-hide-disabled"
                            type="checkbox"><label class="jasmine-label" for="jasmine-hide-disabled">hide disabled
                            tests</label></div>
                </div>
            </div>
        </div>
        <ul class="jasmine-symbol-summary"></ul>
        <div class="jasmine-alert"><span class="jasmine-duration">finished in 0.006s</span><span
                class="jasmine-overall-result jasmine-bar  jasmine-incomplete ">Incomplete: No specs found, <span
                    class="jasmine-seed-bar">, randomized with seed <a title="randomized with seed 79081"
                        href="/C:/Users/shane/AppData/Local/Temp/Temp1_jasmine-testing-exercises.zip/jasmine-testing-exercises/calculator/calculator-test.html?seed=79081">79081</a></span></span>
        </div>
        <div class="jasmine-results">
            <div class="jasmine-failures"></div>
            <div class="jasmine-summary"></div>
        </div>
    </div>
</body>

</html>
